package week2.day2;

public class LearnSwitch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int month=12;
		
		switch(month) {
		
		case 1:
			System.out.println("january");
			
					
	    case 2:
			System.out.println("febuary");
			
	    default:
	    	System.out.println("september");
	    	
		
		}
		
		
		
		
	}
	
}
		
			
		

	


